// client/src/components/ViewAirplanes.jsx

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Form.css';

export default function ViewAirplanes() {
  const [planes, setPlanes]   = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError]     = useState('');

  const fetchPlanes = async () => {
    setLoading(true);
    setError('');
    try {
      const res = await axios.get('/api/airplanes');
      console.log('FETCH /api/airplanes →', res.data);
      setPlanes(res.data);
    } catch (err) {
      console.error('❌ Fetch airplanes failed', err);
      setError(err.response?.data?.error || 'Failed to load airplanes');
    } finally {
      setLoading(false);
    }
  };

  // run once on component mount
  useEffect(() => {
    fetchPlanes();
  }, []);

  return (
    <div className="view-container">
      <h2>View Airplanes</h2>

      <button
        className="refresh-btn"
        onClick={fetchPlanes}
        disabled={loading}
      >
        {loading ? 'Loading…' : 'Refresh'}
      </button>

      {error && <p className="error-text">{error}</p>}

      <table className="data-table">
        <thead>
          <tr>
            <th>Airline ID</th>
            <th>Tail #</th>
            <th># Seats</th>
            <th>Speed</th>
            <th>Location ID</th>
            <th>Type</th>
            <th>Maintenanced</th>
            <th>Model</th>
            <th>NEO?</th>
          </tr>
        </thead>
        <tbody>
          {planes.map((p, i) => (
            <tr key={`${p.airlineID}-${p.tail_num}-${i}`}>
              <td>{p.airlineID}</td>
              <td>{p.tail_num}</td>
              <td>{p.seat_capacity}</td>
              <td>{p.speed}</td>
              <td>{p.locationID || '—'}</td>
              <td>{p.plane_type   || '—'}</td>
              <td>{p.maintenanced == null ? '—' : String(p.maintenanced).toUpperCase()}</td>
              <td>{p.model        || '—'}</td>
              <td>{p.neo          == null ? '—' : String(p.neo).toUpperCase()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
